import React, { Component } from "react";
import "./Counter.css";



class Counter extends Component{
    constructor(){
        super();
        this.state = {
            counter : 0
        }
    }
render(){
    return <div>
        <button onClick={this.increment}>+1</button>
        <span className="count">{this.state.counter}</span>
    </div>
}

increment() {
    console.log("increment");
}
};

export default Counter;
